def auptod(maxdigits):
  alst = [0]
  for k in range(1, maxdigits+1):
    for d1 in range(1, 10):
      d = [(d1*i)%10 for i in range(1, k+1)]
      if d1 == d[-1]: alst.append(int("".join(map(str, d))))
  return alst
